import React from "react";
import TopicBox from "../components/TopicBox";
import Content from "../components/Content";
import { Link, useNavigate } from "react-router-dom";
import { Button } from "react-bootstrap";
//short form rfc

export default function Home() {
  const Navigate = useNavigate();
  return (
    <div>
      <h1>Homepage</h1>
      <TopicBox />
      <Content paragraph="1st Paragraph" />
      <Content paragraph="2nd Paragraph">
        <span>This is the description</span>
      </Content>
      <Content paragraph="3rd Paragraph">
        <button>This is a button</button>
      </Content>
      <br />
      {/* <a href="/contact">Contactus</a> */}
      <Link to="/contact">Go to contacts page!</Link>
      <br />
      {/* <a href="/about">About us</a> */}
      <Link to="/about">Go to abouts page!</Link>
      <br />
      {/* <a href="/about">About us</a> */}
      <Link to="/effect">Go to useEffects page!</Link>
      <br />
      <Button onClick={() => Navigate("/event")}>Go to event handling Page</Button>
    </div>
  );
}
